import { StyleSheet, Text, View,SafeAreaView,StatusBar,ScrollView,FlatList } from 'react-native';
import Company from './components/company';

const companyData=[
  {
    name:"Google",
    image:require("./assets/company1.jpg"),
    data:`Google LLC is an American multinational
    technology company focusing on artificial intelligence, 
    online advertising, search engine technology, cloud computing,
     computer software, quantum computing, e-commerce, 
     and consumer electronics.`
  },
  {
    name:"Google",
    image:require("./assets/company1.jpg"),
    data:`Google LLC is an American multinational
    technology company focusing on artificial intelligence, 
    online advertising, search engine technology, cloud computing,
     computer software, quantum computing, e-commerce, 
     and consumer electronics.`
  }  
]

const data=[{name:"usa",rank:1}]

export default function App() {
  return (
    <SafeAreaView style={{flex:1}}>
      <ScrollView style={styles.container}>
        <Company companyData={companyData}/>
        <FlatList
        data={data}
        renderItem={({item})=><Text>{"hello"+item.name}</Text>}
        keyExtractor={(item)=>item}
        />
      </ScrollView>
    </SafeAreaView>  
  );
}

const styles = StyleSheet.create({
  container: {
    backgroundColor:"#0003",
    marginTop:StatusBar.currentHeight,
    flex:1
  },
});
